import React from 'react'

const Context = React.createContext()

export class Provider extends React.Component {
    state = {
        todos : [
            {
                id: 1,
                title: 'Check emails',
                complete: false
            },
            {
                id: 2,
                title: 'Check voicemails',
                complete: false
            },
            {
                id: 1,
                title: 'Check report',
                complete: false
            }
        ]
    }

    render () {
        return (
            <Context.Provider value={this.state}>
                {this.props.children}
            </Context.Provider>
        )
    }
}

export const Consumer = Context.Consumer
